void Draw_Line(int x1,int y1,int x2,int y2,int color)
{
  if((x2>=x1)&&(y2>=y1))//Both Pozitive
  {
  float dx=x2-x1;
  float dy=y2-y1;
  float Dyx=dy/dx;
  float Dxy=dx/dy;
  float y=y1;
  float x=x1;
  for(int i=x1;i<=x2;i++)
    ssd1963_SetPoint(i,y+=Dyx,color);
  for(int j=y1;j<=y2;j++)
    ssd1963_SetPoint(x+=Dxy,j,color);
  }
  else if((x2>=x1)&&(y2<y1))//X-positive,Y-negative
  {
  float dx=x2-x1;
  float dy=y1-y2;
  float Dyx=dy/dx;
  float Dxy=dx/dy;
  float y=y2;
  float x=x1;
  for(int i=x1;i<=x2;i++)
    ssd1963_SetPoint(i,y+=Dyx,color);
 /* for(int j=y2;j<=y1;j++)
    ssd1963_SetPoint(x+=Dxy,j,color);*/
  }
  else if((x2<x1)&&(y2>=y1))
  {
  float dx=x2-x1;
  float dy=y2-y1;
  float Dyx=dy/dx;
  float Dxy=dx/dy;
  float y=y1;
  float x=x1;
  for(int i=x1;i<x2;i++)
    ssd1963_SetPoint(i,y+=Dyx,color);
  for(int j=y1;j<y2;j++)
    ssd1963_SetPoint(x+=Dxy,j,color);
  }
  else if((x2<x1)&&(y2<y1))
  {
  float dx=x2-x1;
  float dy=y2-y1;
  float Dyx=dy/dx;
  float Dxy=dx/dy;
  float y=y1;
  float x=x1;
  for(int i=x1;i<x2;i++)
    ssd1963_SetPoint(i,y+=Dyx,color);
  for(int j=y1;j<y2;j++)
    ssd1963_SetPoint(x+=Dxy,j,color);
  }
  
}


















































